import React from 'react'
import { WorkExperienceLayout } from './Layout'
import { Box, List, ListItem, ListItemIcon, ListItemText, Typography } from '@mui/material'
import ArrowRightIcon from '@mui/icons-material/ArrowRight';
import AboutImage from '../static/backgroundTexture.jpg'



export const WorkExperience = () => {
    interface ArrowListItemProps {
        description: string
    }

    const ArrowListItem = ({ description }: ArrowListItemProps) => {
        return (
            <ListItem>
                <ListItemIcon>
                    <ArrowRightIcon />
                </ListItemIcon>
                <ListItemText primary={description} />
            </ListItem>
        )
    }
    return (
        <Box
            display={'flex'}
            flexDirection={'column'}
            sx={{
                backgroundImage: `url(${AboutImage})`,
            }}
        >
            <WorkExperienceLayout>
                <Typography variant={'h1'} sx={{ marginBottom: 2 }}>Professional Experience</Typography>
                <Box display={'flex'} flexDirection={'column'} justifyContent={'left'}>
                    <Typography variant={'h2'} sx={{ marginBottom: 1 }}>Software Developer @ Microquest</Typography>
                    <List dense={true}>
                        <ArrowListItem description={'•	Designed and implemented scalable and efficient relational database schemas using PostgreSQL and SQL to support critical application features'} />
                        <ArrowListItem description={'TypeScript'} />
                        <ArrowListItem description={'React'} />
                        <ArrowListItem description={'Node.js'} />
                        <ArrowListItem description={'Solidity'} />
                    </List>

                    <Typography variant={'h2'} sx={{ marginBottom: 2 }}>Engineering Intern, Software/Finance Team @ BluEarth Renewables</Typography>
                    <Typography variant={'h2'}>Business Analyst Intern @ BluEarth Renewables</Typography>
                    <Box
                        display={'flex'}
                        gap={5}
                    >

                        <List dense={true}>
                            <ArrowListItem description={'C#'} />
                            <ArrowListItem description={'.NET'} />
                            <ArrowListItem description={'GraphQL'} />
                            <ArrowListItem description={'PostgreSQL'} />
                            <ArrowListItem description={'Azure'} />
                        </List>
                    </Box>
                </Box>

            </WorkExperienceLayout>
        </Box>
    )
}
